public class DocumentClassifierFactory(string resourceName = null, Action<Humidifier.Comprehend.DocumentClassifier> factoryAction = null) : ResourceFactory<Humidifier.Comprehend.DocumentClassifier>(resourceName)
{

    internal InnerDocumentClassifierDocumentClassifierOutputDataConfigFactory OutputDataConfigFactory { get; set; }

    internal InnerDocumentClassifierVpcConfigFactory VpcConfigFactory { get; set; }

    internal InnerDocumentClassifierDocumentClassifierInputDataConfigFactory InputDataConfigFactory { get; set; }

    protected override Humidifier.Comprehend.DocumentClassifier Create()
    {
        var documentClassifierResult = CreateDocumentClassifier();
        factoryAction?.Invoke(documentClassifierResult);

        return documentClassifierResult;
    }

    private Humidifier.Comprehend.DocumentClassifier CreateDocumentClassifier()
    {
        var documentClassifierResult = new Humidifier.Comprehend.DocumentClassifier
        {
            GivenName = InputResourceName,
        };

        return documentClassifierResult;
    }
    public override void CreateChildren(Humidifier.Comprehend.DocumentClassifier result)
    {
        base.CreateChildren(result);

        result.OutputDataConfig ??= OutputDataConfigFactory?.Build();
        result.VpcConfig ??= VpcConfigFactory?.Build();
        result.InputDataConfig ??= InputDataConfigFactory?.Build();
    }

} // End Of Class

